import React from 'react';
import bridge from '@vkontakte/vk-bridge';
import '@vkontakte/vkui/dist/vkui.css';
import { View, Panel, PanelHeader, CardGrid, Banner, Button, Card, Cell, Avatar, Div, Placeholder, Separator, Gallery, Group, Header, Counter, FormLayout } from '@vkontakte/vkui';
import Icon16Add from '@vkontakte/icons/dist/16/add';
import Icon24Smile from '@vkontakte/icons/dist/24/smile';
import TestFeed from './TestFeed';


class Feed extends React.Component {
    constructor (props) {

        super(props);
  
        this.state = {
          slideIndex: 0
        }
      }
    
render() {

    return (

<View id="feed"  activePanel="feed">
<Panel id="feed">
  <PanelHeader>Главная</PanelHeader>
  <Banner
        mode="image"
        header="Обычные скины"
        subheader="Скины для шара"
        background={
          <div
            style={{
              backgroundColor: '#e8f1fb',
              backgroundImage: 'url(https://sun9-31.userapi.com/PQ4UCzqE_jue9hAINefBMorYCdfGXvcuV5nSjA/eYugcFYzdW8.jpg)',
              backgroundPosition: 'right bottom',
              backgroundSize: '90%',
              backgroundRepeat: 'no-repeat',
            }}
          />
        }
        actions={<Button mode="overlay">Подробнее</Button>}
      />
      <Banner
        mode="image"
        header="Питомцы"
        subheader="Скины для частиц"
        background={
          <div
            style={{
              backgroundColor: '#ffe6e8',
              backgroundImage: 'url(https://psv4.userapi.com/c856432/u217521517/docs/d14/fe686f8e175a/iguana.png?extra=9MavLEcnrzdu-7ioeg3yqF6MEVVJwonCLN8KSUk5Af7srHKiuDTiE9g7RH_KmrmYCbnMjPnORfY_d5mVfbZ-4zARoIvObVMZUNPXApSqoBZc4tHN1cE5OygigVDVt4kyB-bqpQ3T13TweSUAHc86Jm5hAA)',
              backgroundPosition: 'right bottom',
              backgroundSize: '102%',
              backgroundRepeat: 'no-repeat',
            }}
          />
        }
        actions={<Button mode="overlay">Подробнее</Button>}
      />
      <Banner
        mode="image"
        header="Частицы"
        subheader="Скины для питомцев"
        background={
          <div
            style={{
              backgroundColor: '#65c063',
              backgroundImage: 'url(https://psv4.userapi.com/c856432/u217521517/docs/d14/fe686f8e175a/iguana.png?extra=9MavLEcnrzdu-7ioeg3yqF6MEVVJwonCLN8KSUk5Af7srHKiuDTiE9g7RH_KmrmYCbnMjPnORfY_d5mVfbZ-4zARoIvObVMZUNPXApSqoBZc4tHN1cE5OygigVDVt4kyB-bqpQ3T13TweSUAHc86Jm5hAA)',
              backgroundPosition: 'right bottom',
              backgroundSize: '102%',
              backgroundRepeat: 'no-repeat',
            }}
          />
        }
        actions={<Button mode="overlay">Подробнее</Button>}
      />
  {/* <Cell
size="l"
description="Группа сервиса"
before={<Avatar src="https://sun9-24.userapi.com/c856520/v856520080/13a615/MOxzZ-wuRFM.jpg"/>}
bottomContent={<Button before={<Icon16Add/>} onClick={() => bridge.send("VKWebAppJoinGroup", {"group_id": 95380950})}disabled>Вступить</Button>} >Nebulous</Cell> */}
<Div>
<Placeholder
             action={<Button before={<Icon24Smile/>} href="https://vk.com/nebulous" size="l">Группа разработчиков</Button>}>
        </Placeholder>
        <TestFeed />
        </Div>
</Panel>
</View>
    )
}
}
export default Feed;
